import React from "react";
import Menu from "../menu/Menu";
import styled from 'styled-components';
import logo_Vicar from "../../assets/images/vicar_sgv.svg";


const BtnCabecalho = styled.a
`    text-align: center;
border-radius: 3px;
padding: 5px 20px;
margin: 0 10px;
font-weight: 600;
border: 2px solid white;
`;
const Page = styled.div` 
    background-color: #181820; 
    `;

const StyledCabecalho = styled.nav`
 background-color: #181820; 
 display: flex;
  justify-content: space-between;
  padding: 0 15vw;
  
  align-items: center;
`;

const Logo = styled.img`
  height: 90px;
  width: 90px;
  padding: 5px;
`;

const Cabecalho = () => {
    return (
        <Page>
            <StyledCabecalho>
                <Logo src={logo_Vicar} alt="Logo Vicar"/>
                <div>
                    <menu>

                    </menu>
                </div>
            </StyledCabecalho>
        </Page>
    );
};

export default Cabecalho;
